if (chrome.bookmarks) {
  const bookmarkMore = document.getElementsByClassName('bookmark-more')[0];
  bookmarkMore.style.display = 'block';
  bookmarkMore.addEventListener('mouseenter',function (params) {
    this.nextElementSibling.className='active';
  });

  const bookmarks = document.getElementById("bookmark");
  bookmarks.addEventListener('mouseleave',function (params) {
    this.className='';
  });
  bookmarks.style.display = "flex";
  chrome.bookmarks.getTree(function (bookmarkTreeNodes) {
    bookmarkTreeNodes.forEach((node) => {
      // 处理书签节点
      processBookmarkNode(node);
    });
  });

  function processBookmarkNode(node) {
    if (node.url) {
      // 这是一个书签节点
      const faviconUrl = getFaviconUrl(node.url);

      const bookmarkItem = document.createElement("a");
      bookmarkItem.className = "bookmark-item";
      bookmarkItem.href = node.url;
      
      let isLoaded = false;
      const bookmarkImg = document.createElement("img");
      bookmarkImg.src = faviconUrl;
      bookmarkImg.onerror = function () {
        this.onerror = null;
        this.src = defaultImg;
      }
      bookmarkImg.onload = function () {
        isLoaded = true;
      }
      setTimeout(() => {
        if (!isLoaded) {
          bookmarkImg.src = defaultImg;
        }
      }, 1000);
      const bookmarkText = document.createElement("div");
      bookmarkText.innerHTML = node.title;
      bookmarkText.className = 'bookmark-text';
      bookmarkItem.appendChild(bookmarkImg);
      bookmarkItem.appendChild(bookmarkText);
      bookmarks.appendChild(bookmarkItem);
    }

    // 如果节点有子节点，递归处理
    if (node.children) {
      node.children.forEach(processBookmarkNode);
    }
  }

  function getFaviconUrl(url) {
    // 生成 favicon URL
    const urlObj = new URL(url);
    return `${urlObj.protocol}//${urlObj.hostname}/favicon.ico`;
  }
}

var defaultImg = 'data:image/png;base64,'